description:
Derry&amp;#039;s finest beat monkeys The Japanese Popstars have remixed Groove Armada at the bands request. &amp;#039;Get Down&amp;#039;, which will be initially available only on Beatport and then available to listen to on Myspace, will be released on Strictly Rhythm next month.

Groove Armada were so impressed by the Derry trio&amp;#039;s effort, they&amp;#039;ve insisted it be released under the name &quot;Groove Armada Vs The Japanese Popstars.&quot;

(See http://www.discogs.com/release/1334438)
